import { players } from "../nba_player_data_20-21-";
import "./PlayerCard.css";
function PlayerCard() {
  console.log("players", players);

  //For now, let's just use one player as example.
  const player = players[0];
  console.log("here is our example player", player);
  const playerData = initializeValues(player);

  function initializeValues(player){
    const divideFTM = player.FT/player.FTA;
    const divideFGM = player.FG/player.FGA;
    //Fix later: how to reference integer 3 as a part of the key string?
    // const threePTM = player.$3P;
    const threePTM = player.PTS;

    const dataArray = [
        {"FGM/A": divideFGM},
        {"FG%": player.FG},
        {"FTM/A": divideFTM},
        {"3PTM": threePTM},
        {"PTS": player.PTS},
        {"REBS": player.TRB},
        {"AST": player.AST}
    ]
    console.log(dataArray);
    return dataArray;
  }
  return (
    <div className="whole-card">
        <h1 className="player-name">{player.Player}</h1>
        <div className="card-box">
            <div className="data-labels">
                <p className="light">FGM/A</p>
                <p>FG%</p>
                <p className="light">FTM/A</p>
                <p>FT%</p>
                <p>3PTM</p>
                <p>PTS</p>
                <p>REBS</p>
                <p>AST</p>
            </div>
            <div className="time-label">Last week</div>
            <div className="data-row">
                {Object.keys(playerData).map((val, k) => <h4 k={k}>{playerData[val]}</h4>)}
                {/* {playerData.map(function(id, value){
                    return (<div key={value}>{id}</div>)
                })} */}
            {/* {sectionIds.map((id) => (
          <div className="CardEditor__section">
            <HeartIcon />
            <div className="CardEditor__sectionContent">
              <div className="CardEditor__label">
                {displayArray[`sectionLabel${id}`]}
              </div>
              <textarea
                className="CardEditor__textarea"
                rows="2"
                name={`sectionContent${id}`}
                value={displayArray[`sectionContent${id}`]}
              />
            </div>
          </div>
        ))} */}
            </div>
            <div className="time-label">Last 2 weeks</div>
            <div className="time-label">Last month</div>
            <div className="time-label">2019 Season</div>
        </div>
    </div>
  );
}

export default PlayerCard;
